import React from 'react';
import './App.css';

function App() {
    return (
        <div className="App">
            {/* Navigation Bar */}
            <nav>
                <ul>
                    <li><a href="#home">Home</a></li>
                    <li><a href="#movies">Movies</a></li>
                    <li><a href="#news">News</a></li>
                    <li><a href="#contact">Contact</a></li>
                </ul>
            </nav>

            {/* Image Section */}
            <div className="image-section">
                <img src=".assets/AA1.jpg" alt="Description" />
            </div>
        </div>
    );
}

export default App;
